import React, { useState } from "react";
import "./index.css";
import watchImage from "../../assets/01930-aku-q-1_2022-02-01/01930-aku-q-1@2x.png";

export const Watch = () => {
  return (
    <div className="container">
      <img src={watchImage} className="watchImage" />
      <div className="infosContainer">
        <div>
          <div className="promoContainer">
            <div id="promo">promo&nbsp;</div>
            <div id="percent">50%</div>
          </div>
        </div>
        <span className="name">garmin</span>
        <span className="description">garmin</span>
      </div>
    </div>
  );
};
